import React, { Component } from 'react';
import Populate from './Populate'

class Screenone extends Component {
  render() {
    return (
      <div>
        <Populate colone="A" coltwo="B" rowone="name" rowtwo="id" rowthree="DOB" data={[
    {
        label: 'Name',
        input: 'input',
        initialvalue: 'value1'
    },

    {
        label: 'Id',
        input: 'input',
        initialvalue: 'value2'
    },

    {
        label: 'DOB',
        input: 'textarea',
        initialvalue: 'value3'
    }
]}/>
      </div>

    );
  }
}

export default Screenone;
